import { FormLabel, Input, TextField, Grid, Button} from "@material-ui/core";
import { Form } from "react-bootstrap";
// import Button from "@material-ui/core/Button";
// import { Grid } from "@material-ui/core";
// import { TextField } from "material-ui";

function SignUpForm({setAge, setUsername, setEmail, setPassword, setPasswordConfirmation, setFirstName, setLastName, firstName}) {
// function SignUpForm({setImage}) {

  // console.log("SignUpForm", image)

  return (
    <>
      <Form 
      // encType="multipart/form-data"
      >

        <Grid>
          <TextField
          variant="outlined"
          label="First Name"
          name="first_name"
          // value={firstName}
          onChange = {e=>setFirstName(e.target.value)}
          />
        </Grid>

        <Grid>
          <TextField
          variant="outlined"
          label="Last Name"
          name="last_name"
          // value={lastName}
          onChange = {e=>setLastName(e.target.value)}
          />
        </Grid>
        <Grid>
          <TextField
          variant="outlined"
          label="Username"
          name="username"
          // value={firstName}
          onChange = {e=>setUsername(e.target.value)}
          />
        </Grid>
        <Grid >
          <TextField
          variant="outlined"
          label="Email"
          name="email"
          // value={firstName}
          onChange = {e=>setEmail(e.target.value)}
          />
        </Grid>
        <Grid>
          <TextField
          variant="outlined"
          label="Password"
          name="password"
          // value={firstName}
          onChange = {e=>setPassword(e.target.value)}
          />
        </Grid>
        <Grid>
          <TextField
          variant="outlined"
          label="Confirm Password"
          name="password_confirmation"
          // value={firstName}
          onChange = {e=>setPasswordConfirmation(e.target.value)}
          />
        </Grid>








